new WindowAdapter(){
  @Override public void windowClosed(  WindowEvent e){
    if (atmisp.isAlive()) {
      SwingUtilities.invokeLater(() -> {
        JOptionPane.showMessageDialog(null,Lang.get("msg_ATMISPIsStillRunning"));
        atmisp.terminate();
      }
);
    }
  }
}

